import React from "react";

export default function Keyword(props) {
  if (props.data !== null) {
    return (
      <div className="definition ">
        <h1 className="text-capitalize">{props.data.word}</h1>
        <h4>{props.data.meanings[0].partOfSpeech}</h4>
        <p>{props.data.meanings[0].definitions[0].definition}</p>
        <em>{props.data.meanings[0].definitions[0].example}</em>
      </div>
    );
  } else {
    return null;
  }
}
